name: aws_compliance
version: 0.5.0
config-version: 2
profile: aws_compliance
model-paths:
  - models
  - ../models
analysis-paths:
  - analyses
test-paths:
  - tests
seed-paths:
  - seeds
macro-paths:
  - ../macros
  - ../../macros
snapshot-paths:
  - snapshots
clean-targets:
  - target
  - dbt_packages
dispatch:
  - macro_namespace: dbt_utils
    search_order:
      - aws_compliance
      - dbt_utils
